import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import CaseSearch from '../components/CaseSearch';

function Home() {
  return (
    <Box>
      <Box sx={{ p: 2, bgcolor: 'background.paper', border: '1px solid #D1D5DB', mb: 4 }}>
        <Typography variant="h1" gutterBottom>
          He Team - Your Law Associate
        </Typography>
        <Typography variant="h5" color="text.secondary" gutterBottom>
          Dedicated Legal Support for Men Across India
        </Typography>
        <Typography variant="body1" paragraph>
          We specialize in menâ€™s legal cases, offering expert advice and advocate connections for just Rs. 499/- registration fee.
        </Typography>
        <Button variant="contained" component={Link} to="/register" sx={{ bgcolor: 'accent.main' }}>
          Register Now
        </Button>
      </Box>
      <CaseSearch />
    </Box>
  );
}

export default Home;
